const milisec_to_date = (date, format) => {
  switch (format) {
    case "yyyy-mm-dd":
      let arrayDate = date.split("-");
      let yyyy_milisec =
        ((Math.floor(arrayDate[0] - 1972) / 4) * (365 * 4 + 1) +
          ((arrayDate[0] - 1972) % 4) * 365) *
        24 *
        60 *
        60;

      let mm = arrayDate[1];
      let dd = arrayDate[2];

      let day = new Date();

      console.log(yyyy_milisec);
      break;

    default:
      break;
  }
};

export default milisec_to_date;
